import time

class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        # max_length =0
        if len(s) == 0:
            max_length =0
            return max_length
        else:
            index =[]
            for i in range(len(s)):
                tmp =[]
                tmp.append(s[i])
                for j in range(i+1,len(s)):
                    if s[j] in tmp:
                        break
                    else:
                        tmp.append(s[j])
                index.append(tmp)
            # max_lin = max(len(x) for x in index )
            # print(index)
        return index
        
